import { BrowserRouter, Route, Routes } from 'react-router-dom';

import './App.scss';
import './Componentes/carrossel';
import './Componentes/formulario';
import './Componentes/navbar';
import './Componentes/rodape';

function App() {
  return (
    <>

    <BrowserRouter>
    <Routes>
      <Route index path='/navbar' element={<navbar/>}/>
    </Routes>
    </BrowserRouter>
    <navbar />
    <carrossel />
    <formulario />
    <rodape />

    </>
  );
}

export default App;
